import junit.framework.TestFailure;

import org.testng.Assert;
import org.testng.annotations.BeforeTest;
import org.testng.annotations.DataProvider;
import org.testng.annotations.Test;

import com.intuit.tank.harness.test.data.Variables;
import com.intuit.tank.test.TestGroups;

/**
 * JexlStringFunctionsTest
 * 
 * @author dangleton
 * @author rchalmela
 * 
 */
public class JexlStringFunctionsTest {
    private Variables variables;
    public static final String NAME = "Test Name";
    public static final String NAME_1 = "Other Name";
    public static final String ADJECTIVE = "nice";

    @DataProvider(name = "concats")
    private Object[][] concats() {
        return new Object[][] {
                {
                        "Hello #{name}, I want you to meet #{name1}. #{stringFunctions.concat('She ', 'is ', adjective, '.')}",
                        "Hello Test Name, I want you to meet Other Name. She is nice." },
                { "No Replacements", "No Replacements" },
                { "#{stringFunctions.concat('hello there', '.')}", "hello there." }, };
    }

    @DataProvider(name = "substrings")
    private Object[][] substrings() {
        return new Object[][] {
                { "#{stringFunctions.substringBetween('yabcz', 'y', 'z')}", "abc" },
                { "#{stringFunctions.substringBetween('yabcz ydefz', 'y', 'z', 1)}", "def" },
                { "#{stringFunctions.substringBetween('yabcz', null, 'z')}", "yabc" },
                { "#{stringFunctions.substringBetween('yabcz', 'y', null)}", "abcz" },
                { "#{stringFunctions.substringBetween('yabcz', null, null)}", "" },
        };
    }

    @DataProvider(name = "replaceBetween")
    private Object[][] replaceBetween() {
        return new Object[][] {
                {
                        "#{stringFunctions.replaceBetween('', "
                                +
                                "'\"SocialSecurityNumber\":\"', '\"', '123-45-6789', true)}",
                        "" },

                {
                        "#{stringFunctions.replaceBetween('VGhpcyBpcyBhIHNpbXBsZSB0ZXN0', 'is a ', ' test', 'complex', true)}",
                        "VGhpcyBpcyBhIGNvbXBsZXggdGVzdA==" },
                { "#{stringFunctions.replaceBetween('This is a simple test', 'is a ', ' test', 'complex', false)}",
                        "This is a complex test" },
                { "#{stringFunctions.replaceBetween('This is a simple test', 'bogus ', ' test', 'complex', false)}",
                        "This is a simple test" },
                { "#{stringFunctions.replaceBetween('This is a simple test', 'is a ', ' bogus', 'complex', false)}",
                        "This is a simple test" },
                { "#{stringFunctions.replaceBetween('This is a simple test', 'is a ', ' bogus', 'bogus', false)}",
                        "This is a simple test" },
                { "#{stringFunctions.replaceBetween(null, 'is a ', ' bogus', 'complex', false)}", "" },
        };
    }

    @BeforeTest
    public void init() {
        variables = new Variables();
        variables.addVariable("name", NAME);
        variables.addVariable("name1", NAME_1);
        variables.addVariable("adjective", ADJECTIVE);
    }

    @DataProvider(name = "lengths")
    private Object[][] lengths() {
        return new Object[][] { { 5, 5 }, { 4, 4 }, { 3, 3 }, { 2, 2 }, { 1, 1 } };
    }

    @Test(groups = TestGroups.FUNCTIONAL, dataProvider = "replaceBetween")
    public void testReplaceBetween(String expression, String expected) {
        String evaluated = variables.evaluate(expression);
        Assert.assertEquals(evaluated, expected);
    }

    @Test(groups = TestGroups.FUNCTIONAL, dataProvider = "substrings")
    public void testSubstringBetween(String expression, String expected) {
        String evaluated = variables.evaluate(expression);
        Assert.assertEquals(evaluated, expected);
    }

    @Test(groups = TestGroups.FUNCTIONAL, dataProvider = "concats")
    public void testConcat(String expression, String expected) {
        String evaluated = variables.evaluate(expression);
        Assert.assertEquals(evaluated, expected);
    }

    @Test(groups = TestGroups.FUNCTIONAL, dataProvider = "lengths")
    public void testRandom(Integer len, Integer expLen) {

        int length = len.intValue();
        int expLength = expLen.intValue();

        String returned = variables.evaluate("#{stringFunctions.randomAlphaLower(" + length + ")}");
        Assert.assertEquals(returned.length(), expLength);

        returned = variables.evaluate("#{stringFunctions.randomAlphaUpper(" + length + ")}");
        Assert.assertEquals(returned.length(), expLength);

        returned = variables.evaluate("#{stringFunctions.randomAlphaMixed(" + length + ")}");
        Assert.assertEquals(returned.length(), expLength);

        returned = variables.evaluate("#{stringFunctions.randomAlphaMixed(" + length + ")}");
        Assert.assertEquals(returned.length(), expLength);

        returned = variables.evaluate("#{stringFunctions.randomAlphaMixedNumeric(" + length + ")}");
        Assert.assertEquals(returned.length(), expLength);

        returned = variables.evaluate("#{stringFunctions.randomAlphaMixedSpecial(" + length + ")}");
        Assert.assertEquals(returned.length(), expLength);

    }

    @Test(groups = TestGroups.FUNCTIONAL)
    public void testBase64() {
        String evaluated = variables.evaluate("#{stringFunctions.toBase64('hello')}");
        Assert.assertNotNull(evaluated);
        String decoded = variables.evaluate("#{stringFunctions.fromBase64('" + evaluated + "')}");
        Assert.assertEquals(decoded, "hello");
    }

    @Test(groups = TestGroups.FUNCTIONAL)
    public void testUrlEncode() {
        String evaluated = variables.evaluate("#{stringFunctions.urlEncode('&hello')}");
        Assert.assertNotNull(evaluated);
        String decoded = variables.evaluate("#{stringFunctions.urlDecode('" + evaluated + "')}");
        Assert.assertEquals(decoded, "&hello");
    }
    
    @Test(groups = TestGroups.FUNCTIONAL)
    public void testConcatVar() {
        String evaluated = variables.evaluate("#{stringFunctions.concat('Turbo', 'Scale ', name)}");
        Assert.assertNotNull(evaluated);
    }
}
